    wp_set_object_terms($post_id, $car[3], 'color');
    wp_set_object_terms($post_id, $car[4], 'category');

    foreach($car[16] as $key=>$photo){
      $photo_name = str_replace(['.jpg','.jpeg','.png','.PNG','.JPG','.JPEG','.webp','.WEBP'],'',$photo);
      $att = get_page_by_title( pathinfo( 'http://black.cq77457.tmweb.ru/wp-content/uploads/2022/08/'.$photo_name)['filename'], "OBJECT", 'attachment' );
      if($att){
        carbon_set_post_meta( $post_id, 'photos['.$key.']/photo',$att->ID);
      } else {
        echo '<span style="background-color:orange">Нет аттача! http://black.cq77457.tmweb.ru/wp-content/uploads/2022/08/'.$car[16].'</span><br>';
      }
    }
    echo $post_id.' '.$car[0].' - '.$car[1].' - '.$car[19].' added!</p>';
  } else {
    echo '<p style="background-color:coral">Car Exists</p>';
  }
  echo '<hr>';
}


